  const [user,] = useContext(MyUserContext);

  return (
    <>
      <div className="content-home">
      {/* {user.userRole === "ROLE_ADMIN" && <Admin />} */}
        <Toolbar className="toolbar-left" />
        <Restaurant className="list-dish"/>
      </div>
    </>
  );
};

export default Home;
